import React from 'react'

const NielitHQ = () => {
  return (
    <>
      <ul>
      <li className="leaf">
            <Link to="https://www.nielit.gov.in/index.php" title=" NIELIT HQ"> NIELIT HQ</Link>
          </li>
      </ul>
    </>
  )
}

export default NielitHQ
